import React from 'react';
import "../../../src/index.css"
import { helix } from 'ldrs';

helix.register();

const Loading = () => {
   return (
     <div className='Loader-container'>
       <div className="Loader">
       <p> Wait one moment....</p>
       <l-helix
        size="123"
        color="green"
        speed="4">
       </l-helix>   
      </div>

     </div>
   )
}

export default Loading;
